/*Table structure for table `dh_down_goods` */

DROP TABLE IF EXISTS `dh_down_goods`;

CREATE TABLE `dh_down_goods` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商品id',
  `plat_type` varchar(4) DEFAULT NULL,
  `num_iid` varchar(32) DEFAULT NULL COMMENT '平台商品id',
  `outer_id` varchar(32) DEFAULT NULL COMMENT '商家编码',
  `title` varchar(200) DEFAULT NULL COMMENT '商品名称',
  `price` decimal(18,2) DEFAULT NULL COMMENT '商品价格',
  `shop_title` varchar(32) DEFAULT NULL COMMENT '店铺名称',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `down_notice` varchar(255) DEFAULT NULL COMMENT '铺货提示',
  `pic_url` text COMMENT '商品主图片url地址',
  `detail_url` text COMMENT '商品详情页面url',
  `barcode` varchar(64) DEFAULT NULL,
  `spec_num` int(10) DEFAULT NULL COMMENT '商品规格数量（sku行数）',
  `status` char(1) DEFAULT NULL COMMENT '商品状态 0下架 1上架',
  `art_no` varchar(32) DEFAULT NULL COMMENT '商品货号',
  `shop_nick` varchar(30) DEFAULT NULL COMMENT '店铺昵称',
  `down_time` varchar(20) DEFAULT NULL COMMENT '平台下载商品时间戳',
  PRIMARY KEY (`id`)
