DROP TABLE IF EXISTS `dh_down_goods_sku`;

CREATE TABLE `dh_down_goods_sku` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `sku_id` varchar(20) DEFAULT NULL COMMENT '平台商品sku的id',
  `spec` varchar(100) DEFAULT NULL COMMENT '商品sku规格信息（属性id:属性值id:属性名称:属性值名称;',
  `outer_sku_id` varchar(32) DEFAULT NULL COMMENT 'sku级别商家编码',
  `price` decimal(18,2) DEFAULT NULL COMMENT 'sku级别商品单价',
  `plat_type` varchar(4) DEFAULT NULL,
  `cost_price` decimal(18,2) DEFAULT NULL COMMENT '成本价',
  `num_iid` varchar(32) DEFAULT NULL COMMENT '关联商品id',
  `barcode` varchar(64) DEFAULT NULL,
  `down_time` varchar(20) DEFAULT NULL COMMENT 'sku下载时间戳',
  `prop_url` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=514 DEFAULT CHARSET=utf8;

