/*Table structure for table `dh_finance_account` */

DROP TABLE IF EXISTS `dh_finance_account`;

CREATE TABLE `dh_finance_account` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `USER_ID` bigint(20) DEFAULT NULL COMMENT '用户id-暂不用',
  `TYPE` varchar(32) DEFAULT NULL COMMENT '账户类型 1银行 2现金',
  `BANK_NAME` varchar(64) DEFAULT NULL COMMENT '银行名称',
  `BANK_NO` varchar(64) DEFAULT NULL COMMENT '账号',
  `BANK_ACCOUNT` varchar(128) DEFAULT NULL COMMENT '账户名称',
  `AMOUNT` decimal(14,2) DEFAULT NULL COMMENT '期初余额',
  `STATUS` int(1) DEFAULT '1' COMMENT '状态 0 停用 1 启用',
  `ISDEFAULT` int(1) DEFAULT '0' COMMENT '默认账户',
  `CREATE_BY` bigint(20) DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL,
  `MODIFY_BY` bigint(20) DEFAULT NULL,
  `MODIFY_DATE` datetime DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='银行账号';

