/*Table structure for table `dh_menu` */

DROP TABLE IF EXISTS `dh_menu`;

CREATE TABLE `dh_menu` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父级编号',
  `name` varchar(100) NOT NULL COMMENT '名称',
  `sort` decimal(10,0) NOT NULL COMMENT '排序',
  `href` varchar(2000) DEFAULT NULL COMMENT '链接',
  `target` varchar(20) DEFAULT NULL COMMENT '目标',
  `icon` varchar(100) DEFAULT NULL COMMENT '图标',
  `is_show` char(1) DEFAULT '' COMMENT '是否在菜单中显示',
  `create_by` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `modify_by` bigint(20) DEFAULT '0' COMMENT '更新者',
  `modify_date` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记 0删除 1未删除',
  `menu_type` decimal(10,0) DEFAULT NULL COMMENT '0主导航,1父节点,2子节点',
  PRIMARY KEY (`id`),
  KEY `sys_menu_parent_id` (`parent_id`),
  KEY `sys_menu_del_flag` (`del_flag`)
) ENGINE=InnoDB AUTO_INCREMENT=97 DEFAULT CHARSET=utf8 COMMENT='菜单表';

