/*Table structure for table `dh_pur_order` */

DROP TABLE IF EXISTS `dh_pur_order`;

CREATE TABLE `dh_pur_order` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `PUR_NO` varchar(16) NOT NULL COMMENT '采购订单号',
  `CUST_ID` bigint(10) NOT NULL COMMENT '客户id（依赖客户的id）',
  `BUSI_DATE` date DEFAULT NULL COMMENT '业务日期',
  `PUR_TYPE` char(2) DEFAULT NULL COMMENT '采购类型 01-零售 02-批发',
  `PAY_MONEY` decimal(16,2) DEFAULT NULL COMMENT '订单金额',
  `PUR_ORDER_STATUS` char(1) NOT NULL COMMENT '单据状态 1-新建 2-进行中 3-完成 4-作废 5-删除',
  `PUR_IM_STATUS` char(1) DEFAULT NULL COMMENT '入库状态 1-未入库 2-部分入库 3-入库完成',
  `PUR_PAY_STATUS` char(1) DEFAULT NULL COMMENT '付款状态 1-未付款 2-部分付款 3-付款完成',
  `TOTAL_PAY_AMT` decimal(16,2) DEFAULT NULL COMMENT '已付金额',
  `DUE_DATE` date DEFAULT NULL COMMENT '应付日期',
  `FILE_PATH` varchar(200) DEFAULT NULL COMMENT '附件路径',
  `REMARK` varchar(200) DEFAULT NULL COMMENT '备注',
  `CREATE_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '创建日期',
  `MODIFY_BY` bigint(20) DEFAULT NULL COMMENT '修改人',
  `MODIFY_DATE` datetime DEFAULT NULL COMMENT '修改日期',
  `REMARK1` varchar(200) DEFAULT NULL COMMENT '备用字段1',
  `REMARK2` varchar(200) DEFAULT NULL COMMENT '备用字段2',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8;

