/*Table structure for table `dh_sales_order` */

DROP TABLE IF EXISTS `dh_sales_order`;

CREATE TABLE `dh_sales_order` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '订单id',
  `ORDER_NUM` varchar(50) NOT NULL DEFAULT '' COMMENT '订单单据号',
  `SHOP_ID` bigint(11) DEFAULT NULL COMMENT '淘宝店铺ID',
  `FROMCODES` varchar(200) DEFAULT NULL COMMENT '来源订单的编号窜（默认为空,合并后拼接order_num）',
  `TOP_TIDS` varchar(200) DEFAULT NULL COMMENT '交易id(合并的订单多个逗号隔开）',
  `PLAT_TYPE` char(10) DEFAULT NULL COMMENT '订单类型(SG-手工 TB-淘宝 WSC—微商城)',
  `STOCK_ID` bigint(11) DEFAULT NULL COMMENT '订单默认仓库(店铺设置的默认仓库)',
  `CUST_NICK` varchar(64) DEFAULT NULL COMMENT '客户昵称（淘宝接口获取）',
  `IDENTITY_CARD` varchar(32) DEFAULT NULL,
  `RECVNAME` varchar(50) DEFAULT '' COMMENT '收货人',
  `RECVMOBILE` varchar(30) DEFAULT NULL COMMENT '收货手机',
  `RECVPHONE` varchar(30) DEFAULT NULL COMMENT '收货电话',
  `PROV` varchar(30) DEFAULT NULL COMMENT '省',
  `CITY` varchar(30) DEFAULT NULL COMMENT '市',
  `COUNTY` varchar(30) DEFAULT NULL COMMENT '县与区',
  `ADDRESS` varchar(500) DEFAULT '' COMMENT '收货地址',
  `ZIPCODE` varchar(10) DEFAULT NULL COMMENT '邮编',
  `EXPID` bigint(11) DEFAULT NULL COMMENT '物流公司编号',
  `DELIVERYCOST` decimal(18,2) DEFAULT NULL COMMENT '物流成本',
  `DELIVERYFEE` decimal(18,2) DEFAULT '0.00' COMMENT '物流费用',
  `ADJUSTFEE` decimal(18,2) DEFAULT '0.00' COMMENT '调整金额',
  `DISCOUNTFEE` decimal(18,2) DEFAULT '0.00' COMMENT '优惠金额(例如打折等优惠)',
  `TOTAL_FEE` decimal(18,2) DEFAULT '0.00' COMMENT '订单总金额',
  `PAYED_MONEY` decimal(18,2) DEFAULT '0.00' COMMENT '已付金额',
  `TAX_AMOUNT` decimal(18,2) DEFAULT '0.00' COMMENT '裞额',
  `STANDARD_WEIGHT` decimal(18,2) DEFAULT NULL COMMENT '标准重量',
  `REAL_WEIGHT` decimal(18,2) DEFAULT NULL COMMENT '实际重量',
  `NEEDINVOICE` char(1) DEFAULT NULL COMMENT '需发票吗',
  `INVOICEMEMO` varchar(500) DEFAULT NULL COMMENT '发票备注',
  `EXPCODE` varchar(50) DEFAULT NULL COMMENT '物流单号',
  `PLAT_STATUS` varchar(30) DEFAULT '1' COMMENT '平台订单交易状态 和淘宝一致',
  `ORDER_POINT` bigint(20) DEFAULT NULL COMMENT '积分(暂时不用)',
  `HASSEND` char(1) DEFAULT NULL COMMENT '是否发货 ',
  `HASMERGE` char(1) DEFAULT NULL COMMENT '是否已合并',
  `SEND_BY` varchar(50) DEFAULT NULL COMMENT '发货人',
  `SEND_TIME` datetime DEFAULT NULL COMMENT '发货时间',
  `BUYER_FLAG` char(10) DEFAULT NULL COMMENT '买家备注旗帜',
  `BUYER_MEMO` varchar(500) DEFAULT NULL COMMENT '买家留言（代替BuyerMessage）',
  `SELLER_FLAG` char(10) DEFAULT NULL COMMENT '卖家备注旗帜',
  `SELLER_MEMO` varchar(500) DEFAULT NULL COMMENT '卖家备注',
  `DOWN_NOTICE` varchar(200) DEFAULT NULL COMMENT '下载信息',
  `MARK` varchar(500) DEFAULT NULL COMMENT '标注(文字  审单员使用)',
  `PLANSEND_DATE` date DEFAULT NULL COMMENT '计划发货日期(暂不使用此字段)',
  `PAY_TIME` date DEFAULT NULL COMMENT '付款时间',
  `HasFAudit` char(1) DEFAULT NULL COMMENT '是否已审单(0-否 1-是)',
  `DISABLED` char(1) DEFAULT NULL COMMENT '作废(只有新增状态才能作废) (0-否 1-是)',
  `HASREFUND` char(1) DEFAULT NULL COMMENT '是否已退款(0-否 1-是)',
  `ECPRINTED` char(1) DEFAULT NULL COMMENT '已打印快递单(0-否 1-是)',
  `SENDPRINTED` char(1) DEFAULT NULL COMMENT '是否已打印发货单(0-否 1-是)',
  `HASSCANED` char(1) DEFAULT NULL COMMENT '是否扫描(0-否 1-是)',
  `WAVE_ID` int(11) DEFAULT NULL COMMENT '波次ID（拣货业务需要的序号）',
  `WAVE_NO` varchar(20) CHARACTER SET latin1 DEFAULT NULL COMMENT '拣货单号',
  `BUY_TIME` datetime DEFAULT NULL COMMENT '拍单时间',
  `HASPROM` char(1) DEFAULT NULL COMMENT '是否已做促销(下载默认为0)(0-否 1-是)',
  `TIMESTAMP` varchar(20) DEFAULT 'CURRENT_TIMESTAMP' COMMENT '时间戳(下载订单时的时间戳)',
  `RTN_MONEY` decimal(8,2) DEFAULT '0.00' COMMENT '退款金额(后续业务需求)',
  `CREATE_BY` bigint(30) DEFAULT NULL COMMENT '创建人',
  `CREATE_DATE` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `MODIFY_BY` bigint(30) DEFAULT NULL COMMENT '修改人',
  `MODIFY_DATE` datetime DEFAULT NULL COMMENT '修改时间',
  `REMARK1` varchar(100) DEFAULT NULL COMMENT '备用字段1',
  `REMARK2` varchar(100) DEFAULT NULL COMMENT '备用字段2',
  `REMARK3` varchar(100) DEFAULT NULL COMMENT '备用字段3',
  `REMARK4` varchar(100) DEFAULT NULL COMMENT '备用字段4',
  `EXCEPTION_STATUS` varchar(20) DEFAULT NULL COMMENT '异常状态(0-正常 1-异常)',
  `MODIFIED` datetime DEFAULT NULL COMMENT '平台修改时间',
  `SEND_STATUS` varchar(20) DEFAULT NULL COMMENT '发货状态(0-未发货 1-已发货)',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=9362 DEFAULT CHARSET=utf8;

