/*Table structure for table `dh_sales_orderaction` */

DROP TABLE IF EXISTS `dh_sales_orderaction`;

CREATE TABLE `dh_sales_orderaction` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `ORDER_ID` bigint(20) DEFAULT NULL COMMENT '订单ID',
  `ACTION_TYPE` varchar(32) CHARACTER SET utf8 NOT NULL COMMENT '操作类型 下单 修改 审核 合并 拆分 打印 扫描 出库',
  `ACTION_MEMO` varchar(200) CHARACTER SET utf8 NOT NULL COMMENT '如： 由  112 ，113 合并成 114',
  `ACTION_BY` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '操作人',
  `ACTION_TIME` datetime DEFAULT NULL COMMENT '操作时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=227 DEFAULT CHARSET=latin1 COMMENT='订单操作记录表';

