/*Table structure for table `dh_sales_orderitem` */

DROP TABLE IF EXISTS `dh_sales_orderitem`;

CREATE TABLE `dh_sales_orderitem` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '子订单ID',
  `OID` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT 'Top_Order的Oid',
  `ORDER_ID` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '订单序号(主表id)',
  `TB_ID` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '淘宝交易单号',
  `OUTER_IID` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '商品级别商家编码',
  `OUTER_SKU_ID` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT 'sku级别商家编码',
  `LOC_ID` bigint(32) DEFAULT NULL,
  `GDS_ID` bigint(11) DEFAULT NULL COMMENT '商品id',
  `QTY` bigint(20) DEFAULT NULL COMMENT '购买数量',
  `SALSE_PRICE` decimal(18,2) DEFAULT NULL COMMENT '销售价格',
  `TOTSAL_MONEY` decimal(18,2) DEFAULT NULL COMMENT '小计（商品金额 * 数量 + 手动调整 - 优惠金额）',
  `ISGIFT` bit(1) DEFAULT b'0' COMMENT '是赠品(默认0)',
  `MEMO` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '备注(自己修改)',
  `NUMIID` bigint(20) DEFAULT NULL COMMENT '淘宝商品ID',
  `TOP_SKUID` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '淘宝SKUID',
  `REFUND_STATUS` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '退款状态（0 未退款  1退款）',
  `REMARK1` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '备用字段1',
  `REMARK2` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '备用字段2',
  `REMARK3` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '备用字段3',
  `STATUS` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '0正常,1退货 9被淘宝关闭（包含被退款）',
  `PLAT_STATUS` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '平台子订单状态(与淘宝一致)',
  `PLAT_REFUND_STATUS` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '平台退款状态(与淘宝一致)',
  `GDS_NAME` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `ADJUST_FEE` decimal(18,2) DEFAULT NULL COMMENT '调整金额',
  `DISCOUNT_FEE` decimal(18,2) DEFAULT NULL COMMENT '折扣金额',
  `PAYMENT` decimal(18,2) DEFAULT NULL COMMENT '实际付款',
  PRIMARY KEY (`ID`,`PLAT_STATUS`)
) ENGINE=InnoDB AUTO_INCREMENT=19078 DEFAULT CHARSET=latin1;

