/*Table structure for table `dh_sales_rtnorder` */

DROP TABLE IF EXISTS `dh_sales_rtnorder`;

CREATE TABLE `dh_sales_rtnorder` (
  `RTN_ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '退货单ID',
  `RTN_NO` varchar(32) NOT NULL DEFAULT '' COMMENT '退货单据号',
  `ORDER_ID` int(11) NOT NULL COMMENT '关联订单号',
  `STOCK_ID` int(11) NOT NULL COMMENT '仓库编号',
  `SHOP_ID` int(11) DEFAULT NULL COMMENT '店铺名称',
  `CUST_NICK` varchar(32) NOT NULL DEFAULT '' COMMENT '客户昵称（唯一）',
  `GOODS_MONEY` decimal(14,2) NOT NULL COMMENT '总货款',
  `RTNCASH` decimal(14,2) NOT NULL COMMENT '实退总金额[rtnCash]=货款GoodsMony+运费carriage',
  `EXP_ID` int(11) DEFAULT NULL COMMENT '物流公司编号',
  `RECV_NAME` varchar(50) NOT NULL DEFAULT '' COMMENT '收货人',
  `RECV_MOBILE` varchar(30) DEFAULT NULL COMMENT '收货手机',
  `RECV_PHONE` varchar(30) DEFAULT NULL COMMENT '收货电话',
  `PROV_ID` varchar(30) DEFAULT NULL COMMENT '省',
  `CITY_ID` varchar(30) DEFAULT NULL COMMENT '市',
  `COUNTY_id` varchar(30) DEFAULT NULL COMMENT '县与区',
  `ADDRESS` varchar(300) NOT NULL DEFAULT '' COMMENT '收货地址',
  `ZIPCODE` varchar(10) DEFAULT NULL COMMENT '邮编',
  `EXPCODE` varchar(50) DEFAULT NULL COMMENT '物流单号',
  `RTNREASON` varchar(100) DEFAULT NULL COMMENT '退货原因描述',
  `STATUS` int(11) DEFAULT '1' COMMENT '退货单状态 1新建,2确认,3取货,4入库,5审核,-1取消',
  `DELIVERYFEEee` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '物流费用',
  `ISDELETED` bit(1) NOT NULL DEFAULT b'0',
  `RECEIVED` bit(1) NOT NULL DEFAULT b'0' COMMENT '收货',
  `HasScaned` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否扫描',
  `Timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '时间戳',
  `InteriorMemo` text COMMENT '内部留言',
  `CREATE_BY` bigint(20) DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL,
  `MODIFY_BY` bigint(20) DEFAULT NULL,
  `MODIFY_DATE` datetime DEFAULT NULL,
  `plat_Type` varchar(10) DEFAULT NULL COMMENT '订单类型(SG-手工 TB-淘宝 WSC—微商城)',
  `expid` bigint(20) DEFAULT NULL COMMENT '物流ID',
  `carriage` decimal(10,2) DEFAULT NULL COMMENT '退货运费',
  PRIMARY KEY (`RTN_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;

